let account={"D1ADST1":"0x85e19d642d24fe428Eb9205F077a856CA8bC95B0","D1ADST2":"0x1527849623379d4B8E9493b80De864cFf94D38b7","D1ADST3":"0xdE8D7389B3278146E0D695E0fD5f1de764c0a4a3","D2ADST1":"0xF68BcD86dAb0f85F71BD4888701487592a7dF19D","D2ADST2":"0x1ed66dd64c84d3bD56862DfCF065aABe985DBbe8","D2ADST3":"0x235AdA8bB5ec133854791849ECffe62dc7039153","DIVISION1":"0x3b0a64ab25452f6c62FaaB1E2A7EF6177Fdf8a9e","DIVISION2":"0xE044661cd200BaF21574D32A2eB567a78be26640","DGST":"0x1A1638cEcDe8ad09e0913F6E48E0e27DF45BB7Ea","MANUFACTURER":""};
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
   <Context.Provider value={account}>
      <App/>
   </Context.Provider>
);
export default Context;
